素材もプリントも安心の<b>日本製ワックスペーパー</b>。<br /><br>両面に蝋引き（WAX）加工をしてあるので耐水＆耐油に優れています。<br><br />手作り石鹸のラッピングにピッタリ♪<br />くしゃくしゃっと無造作に包んでもなぜかキュートに決まります！<br /><br />手作りお菓子、パン、お弁当もまるでお店で買ったように美しく盛り付けられますよ。 <br /><br />マスキングテープとの相性もバツグンなんですよ。<br><br />持っているだけで楽しい気持ちになるＷＡＸペーパー。<br>毎日の暮らしにぜひ取り入れてみて。<br><br>【サイズ】1枚のサイズ：218×250ミリ　箱：224×70×高さ40ミリ<br>【素材】紙、パラフィン<br>【数量】50枚<br /><br /><!-- ↓ポストお届け不可バナー↓ --><img src="http://image.rakuten.co.jp/cafe-de-savon/cabinet/default/not_mail2.jpg" alt="この商品は「宅急便発送」になります" /><!-- ↑ポストお届け不可バナー↑ --><!-- ここから リア受 -->
