割烹着 小保方さんも着用!? 和装 カッポー着  かっぽう着 エプロン 小保方晴子　リケジョ 理系女子 ものまねにも　コスチューム STAP細胞新型万能細胞(STAP〈スタップ〉細胞)の作製に成功した！！かも知れない理化学研究所の小保方(おぼかた)晴子さん(30)が祖母からもらったというかっぽう着を身につけて研究する姿がテレビや雑誌で話題になっています！<br><br>当店でも大人気のかっぽう着です。リケジョの方は勿論コスプレやイベントにもお使いいただけます。本格的なかっぽう着ですのでご満足頂けるかと思います。<br><br>昭和のお母さんのイメージが強い白のかっぽう着ですが年齢問わず着用できます！<br><br>材質　綿 ポリエステル<br><br>サイズ　フリーサイズ<br><br><br><br><font color=#ff0000></font></DIV>
